import memesData from '../memesData';

const Meme = () => {
	const randomImg = () => {
		let meme =
			memesData.data.memes[
				Math.floor(Math.random() * memesData.data.memes.length)
			];
		let { url } = meme;
		console.log(url);
	};

	const array = ['Thing 1', 'Thing 2'];

	const m = array.map((x) => <p>x</p>);

	return (
		<main>
			{m}
			<div className='form' action=''>
				<input
					placeholder='Top text'
					className='form--input'
					type='text'
				/>
				<input
					placeholder='Bottom text'
					className='form--input'
					type='text'
				/>
				<button onClick={randomImg} className='form--button'>
					Get a new meme image 🖼️
				</button>
				{/* <img src={randomImg.url} alt='' /> */}
			</div>
		</main>
	);
};

export default Meme;
